import React, {useState} from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

import { setAlert } from '../../../actions/alert';
// components
import Navbar from '../../layout/Navbar';
import Alert from '../../layout/common/Alert';
// actions
import register from '../../../actions/auth';
// css
import '../../../css/business_login.css';
import '../../../css/stuck.css';
// images
import StuckCoder_Lying_Original_White_BG from '../../../img/official/StuckCoder_Lying_Original_White_BG.svg';

const Company_login = ({ setAlert, register }) => {

    // Login Form
    const [loginFormData, setLoginFormData] = useState({
        loginemail: '',
        loginpassword: ''
    });
    const {loginemail, loginpassword} = loginFormData;
    const loginOnChange = e => setLoginFormData({ ...loginFormData, [e.target.name]: e.target.value});

    const onSubmitLogin = async (e) => {
        e.preventDefault();
        console.log('Success')

    }

    // Registration Form
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        password: '',
        password2: ''
    });
    const {name,email,password,password2} = formData;
    const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value});

    const onSubmit = async (e) => {
        e.preventDefault();
        if(password !== password2) {
            setAlert('Passwords do not match', 'red');
        } else{
            setAlert('Success')
        }

    }

    return (
        <div className="container-login">

            <Navbar />

            <main className="main-login-business">

                <div className="left">

                    <div className="st-card-login">
                        <div className="st-image-2">
                            <img src={StuckCoder_Lying_Original_White_BG} className="st-image-3" alt=""></img>
                        </div>
                        <div className="st-card-el-h2">Business Login</div>

                        <form className="st-form" onSubmit={onSubmitLogin}>

                            <input 
                            className="st-input-field" 
                            type='text' 
                            placeholder='Email' 
                            name='loginemail' 
                            value={loginemail} 
                            onChange={e => loginOnChange(e)}
                            required
                            ></input>

                            <input 
                            className="st-input-field" 
                            type='password' 
                            placeholder='Password' 
                            name='loginpassword' 
                            value={loginpassword} 
                            onChange={e => loginOnChange(e)}
                            required
                            ></input>

                            <button type="submit" className="st-button-secondary" value="Login">Enter</button>

                        </form>

                        <div className="st-card-el-h2">Or</div>
                        <div className="st-card-el-p">Register a new business</div>

                        <div className="st-card-el-h2">Business Registration</div>

                        <form className="st-form" onSubmit={onSubmit}>

                        <input 
                            className="st-input-field" 
                            type='text' 
                            placeholder='Name' 
                            name='name' 
                            value={name} 
                            onChange={e => onChange(e)}
                            required
                        ></input>

                        <input 
                            className="st-input-field" 
                            type='text' 
                            placeholder='Email' 
                            name='email' 
                            value={email} 
                            onChange={e => onChange(e)}
                            required
                        ></input>

                        <input 
                            className="st-input-field" 
                            type='password' 
                            placeholder='Password' 
                            name='password' 
                            value={password} 
                            onChange={e => onChange(e)} 
                            required
                            ></input>

                            <input 
                            className="st-input-field" 
                            type='password' 
                            placeholder='Confirm Password' 
                            name='password2' 
                            value={password2} 
                            onChange={e => onChange(e)}
                            required
                        ></input>

                        <button type="submit" className="st-button-secondary" value="Register">Create</button>

                        </form>

                        <Alert />


                    </div>

                </div>


                <div className="right"></div>


            </main>

            <div className="footer">
                <div className="st-card-el-p">Copyright &copy; Stuckcoder AS 2019 - All Rights Reserved</div>
            </div>
    </div>
    )
}

Company_login.propTypes = {
    setAlert: PropTypes.func.isRequired,
    register: PropTypes.func.isRequired
}

// connect(<state>, <{actions}>)
export default connect(null, { setAlert, register })(Company_login);
